// pages에 있는 모든 페이지파일에 공통적으로 처리해야할 부분을 처리하는 파일
// ant disgin의 css 스타일을 웹핵이 자동으로 처리하도록 원래는 각각의 page파일에 코드를 적어야한다.

import React from 'react'; // Next.js에는 생략가능하지만
import PropTypes from 'prop-types';
import 'antd/dist/antd.css'; // antd css 스타일을 임폴트하면 웹핵이 알아서 처리해준다. (각각의 page파일에 임폴트해야하지만 _app.js에 공통 임폴트 가능)

const App = ({ Component }) => {
  return <Component></Component>;
};

App.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
